import {Web3} from "web3";
const Meta = () => {
    const [acc,setAcc] : any = useState()
    useEffect(()=>{
        async function load():Promise<void>{
            const web3 = new Web3(Web3.givenProvider||'http://localhost:7545');
            const acc = await web3.eth.getAccounts();

            setAcc(acc[0]);
        }
        load();
    },[])
    return (
        <div>

        </div>
    );
};

export default Meta;
